import React from "react";
import { GoogleOAuthProvider } from "@react-oauth/google";
import axios from "axios";

const googleClientId =
  "1004046358549-4he79a4vc7os6t8g3agc299t6r1j3ndm.apps.googleusercontent.com";
const googleOAuthClient = new OAuth2Client(googleClientId);

const LoginWithGoogle = async () => {
  try {
    const response = await googleOAuthClient.login();
    const accessToken = response.credentials.accessToken;
    const serverResponse = await axios.post("/api/google-login", {
      accessToken,
    });
    localStorage.setItem("accessToken", serverResponse.data.accessToken);
    window.location.href = "/home";
  } catch (error) {
    console.error(error);
  }
};
export default LoginWithGoogle;
